type BasicZipCodeData=
  {
  ZipCode:string
  City:string
  State:string
  Population:float
  County:string
  }

let zipCodeFrequenciesList = 
  zipCodeFrequenciesArray 
  |> Array.toList
  |> List.map(fun (x:string*string*string*string*string)->
      let a,b,c,d,e=x
      {
      ZipCode=a
      City=b
      State=c
      Population=System.Double.Parse(d)
      County=e
      }  
    )